    [],nt"revision_timestamp": "2015-09-26T22:31:02.090318",nt"name": "climate-prediction-center-weekly-corn-growing-degree-days",nt"isopen":
    false,nt"url": null,nt"notes": "A corn growing degree day (GDD) is an index
    used to express crop maturity. The index is computed by subtracting a base temperature
    of 50?F from the average of the maximum and minimum temperatures for the day. Minimum
    temperatures less than 50?F are set to 50, and maximum temperatures greater than
    86?F are set to 86. These substitutions indicate that no appreciable growth is detected
    with temperatures lower than 50 or greater than 86. This data is provided weekly
    from March 1 to November 2 of the current year.",nt"license_title": null,nt"extras":
